  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Kenai National
  Wildlife Refuge summarizes refuge activities from May through August of 1953.  The
  report begins with general information about weather conditions, water conditions,
  and fires on the refuge.  Wildlife- including migratory birds, upland game birds,
  big game animals, other mammals, and fish- is also covered.  The report includes
  a refuge development section which discusses physical developments on the refuge.
  \ Economic uses of the refuge are outlined; timber removal was the primary use during
  this period.  The public relations section of the report discusses recreational
  uses of the refuge, refuge visitors, refuge participation, hunting, fishing, and
  violations.  Items of interest and N-R forms are provided at the end of the report.\",\n\t\"license_title\":
